import React from 'react'

class Player extends React.Component {
    render(props) {
        return (
            <div className="Player">
                <h1>{props.playerName}</h1>
                <h3>{props.totalScore}</h3>
                <h3>{props.currentRoll}</h3>
            </div>
        )
    }
}

export default Player;
